import numpy as np
import matplotlib.pyplot as plt
import sympy
sympy.init_printing()

"""![تحويل_لابلاس.jpg](data:image/jpeg;base64,)



"""

"""تعريف كل من ثابت الحساسية و ثابت الزمن و الزمن """
K, tau = sympy.symbols('K, tau',real=True, positive=True)
t, s = sympy.symbols('t, s')
#s = sympy.symbols('s')
a = sympy.symbols('a', real=True, positive=True)
"""تعريف دالة الخطوة """
u = sympy.Heaviside(t)
'''def u(t):
    """Unit step function"""
    return 1 * (t >= 0)'''
"""تعريف تابع لحساب تحويل لابلاس"""
def L(f):
    return sympy.laplace_transform(f, t, s, noconds=True)
"""تعريف تابع لحساب مقلوب لابلاس"""
def invL(F):
    return sympy.inverse_laplace_transform(F, s, t)
f = sympy.exp(-a*t)
U = L(u)
G = K/(tau*s + 1)
sympy.integrate(u*sympy.exp(-s*t) ,(t, 0, sympy.oo))

sympy.plot(u)

"""![S.jpg](data:image/jpeg;base64,)

سوف نقوم بتجزئة الكسور من خلال التابع apart
"""

(G*U).apart(s)

invL((G*U).apart(s))

t_step ,T= np.linspace(-5, 10, 500),1
t = np.linspace(0, 10, 500)
y ,u = 1 - np.exp(-t/T),1
tau_height_01 ,tau_height_02 = 1 - np.exp(-1) ,1 - np.exp(-2)
tau_height_03 ,tau_height_04 = 1 - np.exp(-3) ,1 - np.exp(-4)
tau_height_1 ,tau_height_2 = np.round(((1 - np.exp(-1))*100),1),np.round(((1 - np.exp(-2))*100),1)
tau_height_3 ,tau_height_4 = np.round(((1 - np.exp(-3))*100),1),np.round(((1 - np.exp(-4))*100),1)
def u(t):
    """Unit step function"""
    return 1 * (t >= 0)
fig, ax = plt.subplots()
line1 = ax.plot(t, y, label='EXP')
line2 = ax.plot(t_step, u(t_step) , label='step')
T=1
Line3 = ax.plot([0, T, T], [1*tau_height_01]*2 + [0], alpha=0.4,label='response {:.3}%'.format(tau_height_01*100))
ax.text(0, 1*tau_height_01, '{:.3}%'.format(tau_height_01*100))
T=2
Line4 = ax.plot([0, T, T], [1*tau_height_02]*2 + [0], alpha=0.4,label='response {:.3}%'.format(tau_height_02*100))
ax.text(0, 1*tau_height_02, '{:.3}%'.format(tau_height_02*100))
T=3
Line5 = ax.plot([0, T, T], [1*tau_height_03]*2 + [0], alpha=0.4,label='response {:.3}%'.format(tau_height_03*100))
ax.text(0, 1*tau_height_03, '{:.3}%'.format(tau_height_03*100))
T=4
Line6 = ax.plot([0, T, T], [1*tau_height_04]*2 + [0], alpha=0.4,label='response {:.3}%'.format(tau_height_04*100))
ax.text(0, 1*tau_height_04, '{:.3}%'.format(tau_height_04*100))
ax.legend()
plt.show()
print(str(tau_height_1)+"%" , str(tau_height_2)+"%", str(tau_height_3)+"%",str(tau_height_4)+"%")